import React from "react";
import "./App.css";

import About from "./components/About/About";
import Navbar from "./components/Navbar/Navbar";
import { Switch } from "react-router-dom";

function App() {
  return (
    <div
      style={{
        backgroundImage: ``,
        backgroundSize: "cover",
        overflow: "scroll",
        height: "100vh",
      }}
    >
      <Navbar />
      <div className="App">
        <Switch>

        </Switch>
        <About />
      </div>
      <h1>App.jsx</h1>
    </div>
  );
}

export default App;
